css:
@-moz-document url-prefix("https://catwar.su/") {

div#logo {
display: none;
}
div#menu_div {
background: #9DB1CC;
}
div#site_table {
background: #9DB1CC;    
color: #1D1E33;
}
div#branch {
background: #9DB1CC;
color: #1D1E33;
}
div#footer {
background: #9DB1CC;
color:#1D1E33;
}
body {
    background-image: none;
    color: #1D1E33;
}
body {
    font-size: .9em;
    font-family: Verdana;
    margin: 0;
    padding: 0;
    background-attachment: fixed;
    background-color: #49678D;
}
a:link {
color:#1D1E33;
}
a:visited {
color:#1D1E33;
}
#tr_chat {
    background-color: #9DB1CC;
    padding: 0px;
}
#chat_msg {
    background-color: #9DB1CC;
    border: 0px;
}
#tr_tos {
    background: #9DB1CC;
color:#838383;
}
#tr_sky {
    display: none;
}
#tr_actions {
    background-color: #9DB1CC;
    border: 0px;
}
span#location {
    color: #1D1E33 ;
}
.ui-slider .ui-slider-handle {
    background: #2B6CC4;
    border: 0.5px solid #282828;
}
.ui-slider {
    background: #111111;
    border: 0.5px solid #282828;
    margin-right: 50px;
}
hr {
    border: 0.5px solid #1D1E33;
}
input {
    background-color: #111111;
    color: #1D1E33;
    border: 0.5px solid #282828;
    border-radius: 5px;
}
div#history_block div {
    background: #9DB1CC;
}
div#thdey {
    margin-left: 10px;
}
#history div {
    background:#9DB1CC;
    color: #1D1E33;
}
div#background {
background:#9DB1CC
}
#parameter {
background:#9DB1CC;
}
a#parameters.toggle {
    display: none;
}
#family {
    background-color: #9DB1CC;
}
div#tir {
    background:#9DB1CC;
    color: #1D1E33;
}
.title {
    background:#9DB1CC;
    color: #1D1E33;
}
a#history_clean {
    margin-left: 5px;
}
td#history {
background:#9DB1CC;
}
tr#tr_mouth {
background:#9DB1CC;
}
p#error {
    top: 310px;
    left: 25px;
    background-color: #9DB1CC;
    border: 0.5px solid #282828;
}
#fightPanel {
    background-color: #9DB1CC;
    border: 0.5px solid #2d2d2d;
}
input {
    background-color: #111111;
    color: #1D1E33;
    border: 0.5px solid #282828;
    border-radius: 5px;
}
input:focus {
    background-color: #383838;
}
.hotkey {
    background-color: #383838;
    color: #1D1E33;
    border: 0.5px solid #282828;
    border-radius: 5px;
}
#mit {
    background-color: #111111;
    color: #1D1E33;
    border: 0.5px solid #282828;
    border-radius: 5px;
}
.move_name {
    color: #000000;
}
.nick {
    color: #1D1E33;
}
.adopt-id {
    color: #fff;
}
.cat_tooltip {
background: #383838;
}


}
